import React, {Component} from 'react'
import "./Header.css"

class Header extends Component {
    render(){
        return(
            <header>
                <h1>Basictheory.io</h1>
                <div>
                    <button>Chords</button>
                    <button>Scales</button>
                </div>
            </header>
        );
    }
}

export default Header;
